Assuming you're asking for a simple YAML node structure, here's an example of how you could write a parser in Go:

```go
type YAMLNode map[string]interface{}

func ParseYAML(input string) YAMLNode {
	var node YAMLNode

	reader := strings.NewReader(input)
	for {
		line, err := reader.ReadLine()
		if err == nil {
			node[line] = parseSimpleValue(line)
		} else {
			break
		}
	}

	return node
}

func parseSimpleValue(value string) interface{} {
	switch value {
	case "string":
		return string(value)
	case "int":
		return int(value)
	case "float":
		return float64(value)
	case "bool":
		return bool(value)
	case "array":
		return parseArray(value)
	case "object":
		return parseObject(value)
	default:
		return nil
	}
}

func parseArray(value string) []interface{} {
	elements := parseSimpleValue(value)
	return elements
}

func parseObject(value string) map[string]interface{} {
	object := make(map[string]interface{})

	for key, value := range parseSimpleValue(value) {
		object[key] = value
	}

	return object
}
```

This parser uses the `strings.NewReader` function to create a reader for the YAML input stream, and it uses the `ReadLine` method to read a line from the reader and parse it based on the value of the line. The `parseSimpleValue` function is used to parse simple values, such as strings, integers, floats, booleans, and arrays, and it returns the corresponding value as an interface. The `parseArray` and `parseObject` functions are used to parse arrays and objects, respectively, and they both use the `parseSimpleValue` function to parse their values.

