In CakePHP 3, you can use the `URL::asset()` method in a custom `asset` class to generate a URL for a given file.

Here's an example of how you might use this method:
```php
class MyAsset extends URL Asset {
  public $name;
  public $path;

  public function __construct($name, $path) {
    parent::__construct($name, $path);
    $this->name = $name;
    $this->path = $path;
  }
}
```
In this example, `MyAsset` is the name of the custom asset class you want to use, and `$path` is an instance variable that you can set to the path of the file you want to generate the URL for.

The `URL::asset()` method takes two parameters:

* `$name` is the name of the asset you want to generate the URL for
* `$path` is the path of the asset

You can then use this asset class to generate a URL for a given file:
```php
$filePath = 'path/to/my/file.ext';
$asset = new MyAsset($filePath);
$url = URL:: asset($asset). '/'. $filePath;
echo $url;
```
In this example, `MyAsset` is an instance of the `URL` class that you want to use to generate the URL for a file. The `asset()` method is then used to generate the URL for the file. Finally, the URL is outputted to the browser.
